void print_bytes(char *bytes, int len) {
	int i;
	if (len > 0) {
	for (i=0; i<len; i++) {
		printf("%02x ", (int)((unsigned char)bytes[i]));
	}
	printf("\"");
		for (i=0; i<len; i++) {
		printf("%c", isprint(bytes[i]) ? bytes[i] : '.');
		}
		printf("\"");
	}
}

